import { PureComponent } from 'react'
import {lot} from '../model/lot';

interface props {

}

interface state {
    numLots : number;
    arrLot: Array<lot>;
}

export default class HomeController extends PureComponent<props, state> {
    constructor(props: any) {
        super(props);
        console.log("props lot", props.route.params.item);

        this.state = {
            numLots: props.route.params.item,
            arrLot:[],
        }
    }

    componentDidMount() {
        this.setupAnArray();
    }

    setupAnArray = () => {
        const {numLots} = this.state;

        var temp : Array<lot> = [] ;
        for(let i = 0; i < numLots; i++){
            let dic : lot = {
                id:  "A" + `${i}`,
                carNum: "",
                isAlloted: false,
                inTime: "",
                outTime:"",
            }
            temp.push(dic)
        }

        this.setState({arrLot: temp})
        console.log("temp", temp);

        console.log("this", this.state.arrLot);
    }

}
